  CREATE OR REPLACE FORCE VIEW "INZYNIERKA"."SPRZEDAZ_PRODUCENTOW_P" ("NUMER_RUNDY", "NAZWA_MARKI", "WOLUMEN", "PRZYCHOD") AS 
  SELECT
    s.NUMER_RUNDY, s.NAZWA_MARKI, s.wolumen, s.przychod
FROM
